INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('fae6de45-b863-42b7-a34a-f41f90c0e5a0','11111111-1111-1111-1111-111111111111','Hostel-friendly air cooler with approx 35L tank, 4 fan speeds and energy-efficient motor ideal for cooling studio-style PG rooms in summer','This air cooler has been used for a couple of summers in a BITS-style hostel room and does a decent job of keeping the room more comfortable during the hotter months. The water tank capacity is around 35 litres, which is enough for several hours of continuous use before requiring a refill, depending on fan speed and outside temperature. With 4 selectable fan speeds and adjustable swing, you can choose between a quieter breeze for night-time use or stronger airflow for afternoons.\n\nThe unit runs on an energy-efficient motor and works with regular hostel or PG power points. Cooling pads are in usable condition and still hold water properly, and there are no major cracks in the body. I usually kept it near the window so that it could pull in fresh air and circulate it across the room, which works well for studio-style PG rooms. Wheels or castors, if present, still roll reasonably so it can be moved for cleaning or repositioning. There are standard signs of use like some mineral deposits in the tank and light discolouration on the plastic, but the cooler is still functional and useful if you are looking for an affordable way to manage summer heat without buying a brand-new appliance.',2983.00,0,1,1404.00,100.00,'2025-10-28 15:37:56','2025-11-01 15:37:56',1,'Appliances','2025-09-30 07:31:40','2025-09-30 07:31:40');
