INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('a066e3b3-521e-4865-b924-5257c3d8f66c','44444444-4444-4444-4444-444444444444','Well maintained 18-speed geared campus bicycle with 18-inch steel frame, disc brakes and matte black look for daily BITS Pilani commuting','This geared campus bicycle is set up with a 18-inch steel frame and reliable disc brakes, making it very comfortable for everyday rides between hostel, mess and the academic area. It has been well maintained, never abused for stunts, and has mostly seen smooth campus roads rather than off-road trails. I have used it for one semester, and it still rides smoothly without any strange noises, loose parts or wobble in the wheels. The tyres hold air well over several days, and the chain does not slip when pedalling quickly to early-morning classes.\n\nThe cycle already comes fitted with a strong carrier and bell, so you do not have to worry about basic accessories after buying it. Braking performance is consistent even when the cycle is fully loaded with a backpack, and the handlebar position is comfortable for longer rides across campus. The saddle height can be adjusted easily for different riders using the quick-release mechanism. There are the usual small scratches near the frame and pedals from parking at hostels and departments, but there is no structural damage, rust patches or bent components. Overall, this is a dependable and practical option if you want to save time walking, avoid waiting for buses and have a convenient way to move between hostels, library and departments every single day.',4627.00,1,0,NULL,NULL,NULL,NULL,1,'Sports','2025-09-25 19:57:54','2025-09-25 19:57:54');
