INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('64f8f22a-0f49-46aa-9ac0-aa45c5a89ffd','99999999-9999-9999-9999-999999999999','Comfortable mesh-back study chair with height adjustment lever designed for long online classes at hostel or study table in the BITS Pilani campus','This mesh-back study chair has been my main seating option for online classes and has made long hours of reading, coding and assignment work a lot more bearable. The seat cushion offers decent support without sinking too much, and the backrest provides reasonable comfort for normal student usage. The height adjustment lever make it easier to tune the sitting position so that your knees and back are aligned more comfortably during long sessions at the desk.\n\nThe chair has no broken parts, and overall stability is still good  there is no noticeable wobble in the base when sitting or shifting positions. Armrests, where present, have minor scuff marks from regular use but remain sturdy enough for daily support. The chair fits easily under a typical hostel or off-campus study table, making it practical even in relatively small rooms. There are the usual scratches on the plastic or metal legs from moving it across the floor, but nothing that affects functionality. If you are setting up a slightly more ergonomic study space in your room instead of using the basic hostel chair, this is a sensible and budget-friendly upgrade.',1071.00,0,0,NULL,NULL,NULL,NULL,1,'Furniture','2025-10-18 03:52:53','2025-10-18 03:52:53');
