INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('4c3506a5-f2a8-4c03-bddb-04e90ed4e432','22222222-2222-2222-2222-222222222222','Student-used comfortable wired headphones with clear sound, comfy cushioning and upto 20-hour playback suitable for music, classes and calls','These comfortable wired headphones have been used mainly for evening music sessions and have never been dropped or exposed to rain. The audio quality is clear enough for listening to lectures, watching series or enjoying music while studying, with decent bass and balanced mids. They offer basic noise cancellation, which helps block out some hostel and corridor noise so that you can focus a bit better. Battery life can reach around 20 hours of mixed usage on a full charge in wireless mode, which comfortably covers multiple classes and study sessions.\n\nThe ear cushions are in good condition  the cushions are still soft, and the earcups still feel comfortable even after longer sessions. The headband adjuster works smoothly, making it easy to fit different head sizes. Buttons or inline controls for volume and playback are functional, and the microphone is good enough for regular voice calls or conference calls on Teams and Zoom. There are a few minor scuff marks on the outer side from normal use and keeping them in a bag, but nothing that affects listening experience. Overall, these headphones are a practical choice for students who want a solid pair for daily use without spending on premium audio brands.',2470.00,0,1,1648.00,50.00,'2025-10-28 15:37:56','2025-11-01 15:37:56',1,'Electronics','2025-10-08 13:57:45','2025-10-08 13:57:45');
