INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('78b39644-ca9e-4af9-b0d3-2c8033598066','22222222-2222-2222-2222-222222222222','Single-size 4-inch hostel orthopedic-style mattress with supportive feel and washable cover suitable for BITS Pilani student room use','This listing is for a single-size orthopedic-style mattress that has been used on a standard hostel-style cot for around two years. The 4-inch profile offers a reasonably firm yet comfortable sleeping surface, which works well for most students who do not want an overly soft bed. It has never been exposed directly to water or rain, and I have always kept it covered with a washable cover to avoid direct stains on the mattress surface. There is no sagging in the middle, and the edges still hold shape when you sit at the side of the bed.\n\nThe mattress has the expected minor signs of use such as light impressions in the usual sleeping area, but there are no deep pits or damaged zones. It has been used in a smoke-free, pet-free room, and I periodically aired it near the window for freshness. This makes it a good option if you are moving into a new room and want to avoid buying an expensive brand-new mattress for a limited duration of study. It fits typical hostel cots and most off-campus single beds, and can be transported easily with a cover or bedsheet tied around it.',2526.00,1,1,1636.00,50.00,'2025-11-06 15:37:56','2025-11-07 15:37:56',1,'Furniture','2025-10-30 20:03:44','2025-10-30 20:03:44');
