INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('3428185f-d4cd-4b16-b76d-3e507c4112af','33333333-3333-3333-3333-333333333333','23.8-inch Quad HD 2560x1440 monitor with HDMI and VGA, smooth 75Hz panel ideal for coding, online classes and casual media use','This is a 23.8-inch Quad HD 2560x1440 monitor that I have used mainly for project reports and light gaming during my time at BITS. The screen size is ideal for keeping a code editor, browser and terminal visible side by side without feeling cramped, which really helps during labs and project work. The 75Hz refresh rate makes scrolling and basic animations feel smooth and comfortable on the eyes. Text is sharp, colours are decent for normal use, and there are no dead pixels or screen flicker issues that I have noticed.\n\nConnectivity options include HDMI and VGA, so it works well with laptops, desktops and even some media devices with the right cables. I usually ran it with brightness set to a moderate level, so the panel has not been abused at 100% brightness for long hours. The stand provides a stable base on a standard hostel or study table, and tilt adjustment allows you to set a comfortable viewing angle for long study sessions. There are a few cosmetic scratches on the plastic bezels from shifting rooms and rearranging the table, but the display area itself is clean. It is a practical, value-for-money option if you want more screen space than a laptop display for assignments, reading PDFs or keeping multiple windows open together.',8758.00,1,0,NULL,NULL,NULL,NULL,1,'Electronics','2025-10-03 19:16:35','2025-10-03 19:16:35');
